import "../index.css";
import Mapp from './Mapp'
import * as d3 from "d3";
import * as topojson from "topojson-client";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";
import datum from '../daniel.json'


function Map(props) {

  return (



    <ComposableMap projectionConfig = {{rotation:[4.4,0],parallels:[50,60],scale:1000}}>
    <Geographies geography={datum}>
      {({ geographies }) =>
        geographies.map((geo,index) => {
          console.log(geo)
          return(
        <Geography stroke='black' fill='none' key={index} geography={geo} />
          )
      })
      }
    </Geographies>
  </ComposableMap>


  );
}

export default Map;
